import React from 'react';
import { Document, Page, Text, View, StyleSheet, Image } from '@React-pdf/renderer';

// Define your receipt data
const receiptData = {
  sender: {
    name: 'John Doe',
    address: '123 Main Street',
    city: 'New York',
    state: 'NY',
    zip: '10001',
  },
  recipient: {
    name: 'Jane Smith',
    address: '456 Elm Street',
    city: 'San Francisco',
    state: 'CA',
    zip: '94107',
  },
  // Add more data as needed
};

// Define your styles
const styles = StyleSheet.create({
  // Define your styles similarly to the previous example
  // ...
});

const Reciept = () => {
  return (
    <Document>
      <Page style={styles.page}>
        {/* Header */}
        <Text style={styles.header}>Receipt</Text>

        <View style={styles.sender}>
          <Text style={styles.addressLine}>{receiptData.sender.name}</Text>
          <Text style={styles.addressLine}>{receiptData.sender.address}</Text>
          <Text style={styles.addressLine}>
            {receiptData.sender.city}, {receiptData.sender.state} {receiptData.sender.zip}
          </Text>
        </View>

        {/* Recipient Information */}
        <View style={styles.recipient}>
          <Text style={styles.addressLine}>{receiptData.recipient.name}</Text>
          <Text style={styles.addressLine}>{receiptData.recipient.address}</Text>
          <Text style={styles.addressLine}>
            {receiptData.recipient.city}, {receiptData.recipient.state} {receiptData.recipient.zip}
          </Text>
        </View>

        {/* Add more sections as needed */}
        {/* ... */}

      </Page>
    </Document>
  );
};

export default Reciept;
